import "./Home.css";
import CustomLayout from "../Components/CustomLayout/CustomLayout";
import Cards from "../Components/Cards/Card";
import Pages from "../Components/Pagination/Pagination";

function Home() {
  return (
    <div className="home">
      {/* En el Home paso el componente CustomLayout que incluye Navbar y Footer */}
      <CustomLayout>
        <Cards />
      </CustomLayout>
    </div>
  );
}

export default Home;
